class Client {
  constructor(p2p, wallet, storage) {
    this.p2pClientLib = p2p;
    this.walletClientLib = wallet;
    this.storage = storage;
  }

  updateWallet() {
    rtcClient = this.p2pClientLib.initNewClient();
  }

}

const celestiumlogic = {
  Client: Client,
  p2pClientLib: null,
  walletLib: null,
  storage: null,
    initNewClient() {
    return new celestiumlogic.Client(
      celestiumlogic.p2pClientLib,
      celestiumlogic.walletLib,
      celestiumlogic.storage,
    );
  }
};

module.exports = celestiumlogic;
